var w = $('.canvas-1').width();
var h = $('.canvas-1').height();
var scale = h/w;
var clickX = new Array();
var clickY = new Array();
var clickDrag = false;
var paint;


$('.canvas-1').css({'height': w + 'px'});

$('.canvas-1').mousedown(function(e){
  var rect = this.getBoundingClientRect();
  var mouseX = e.clientX - rect.left;
  var mouseY = Math.round(scale*(e.clientY - rect.top));
  paint = true;
  addClick(mouseX, mouseY);
  redraw();
});

$('.canvas-1').mousemove(function(e){
  var rect = this.getBoundingClientRect();
  var mouseX = e.clientX - rect.left;
  var mouseY = Math.round(scale*(e.clientY - rect.top));
  if(paint){
    addClick(mouseX, mouseY, true);
    redraw();
  }
});

$('.canvas-1').mouseup(function(e){
  grayscale = canvas_grayscale();
  paint = false;
  accuracy(logistic_regression(canvas_grayscale()));
  console.log(logistic_regression(canvas_grayscale()));
});

$('.canvas-1').mouseleave(function(e){
  paint = false;
});


function addClick(x, y, dragging)
{
  clickX.push(x);
  clickY.push(y);
  clickDrag = dragging;
}

function redraw(){
 
 var canvas = document.getElementsByClassName('canvas-1'); 
 var arrayLength = canvas.length;
 for (var j=0; j < arrayLength; j++) {
  var context = canvas[j].getContext("2d");
  context.clearRect(0, 0, context.canvas.width, context.canvas.height);
  context.strokeStyle = "#df4b26";
  context.lineJoin = "round";
  context.lineWidth = 12;

  var i = clickX.length - 1;
  if (clickDrag && i) {
    context.moveTo(clickX[i-1], clickY[i-1]);
  }else{
    context.moveTo(clickX[i], clickY[i]);
  }
  context.lineTo(clickX[i], clickY[i]);
  context.closePath();
  context.stroke();
 }
 canvas_grayscale();
}

function accuracy(score){

 var progress = document.getElementsByClassName('progress-bar');
 var arrayLength = progress.length;
 for (var j=0; j <arrayLength; j++) {
    var s = score[j%10]*100;
    progress[j].style['width'] = s.toFixed(0).toString() + '%';
 }
}

function canvas_grayscale() {
 var canvas = document.getElementsByClassName('canvas-1');
 var grayscale = document.createElement('canvas');
 var context = grayscale.getContext("2d");
 context.drawImage(canvas[0], 0, 0, 28, 28);

 var meta = context.getImageData(0,0,28,28);
 var meta_data = new Array();

 for (var j=0; j<meta.data.length; j+=4) {
  var r = meta.data[j];
  var g = meta.data[j+1];
  var b = meta.data[j+2];
 
 if (r || g || b) {
  meta_data.push(255);
 }
 else {
  meta_data.push(0);
 }
 }

 return meta_data;
}


function multiply(a, b) {
    var rows = a.length;
    var cols = a[0].length;
    var result = new Array();
    for (var j=0; j<rows; j++) {
        result[j] = 0;
        for (var i=0; i<cols; i++) {
            result[j] += a[j][i] * b[i];
        }
    }

    return result;
}

function logistic_regression(image) {
    var A = mc;
    var b = [-0.04329599, -0.00463963, -0.0282267, -0.32874185, -0.0401431, 0.00355729, -0.02817567, -0.00456665, -2.89561207, -0.03663435];
    var arg = multiply(A, image);
    for (var i=0; i<arg.length; i++) {
        arg[i] += b[i];
        arg[i] = 1./(1 + Math.exp(-arg[i]));
    }
    return arg;
}


